import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('#email');
    await page.waitForSelector('#password');

    // Input email and password (replace with actual credentials)
    await page.fill('#email', 'your_email@example.com');
    await page.fill('#password', 'your_password');

    // Take a screenshot after filling the form
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_form.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_form.png'));

    // Click the login button
    await page.click('button.login-btn');

    // Wait for navigation after login
    await page.waitForLoadState('networkidle');

    // Take a screenshot after login
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_login.png'));

    // Search message history for a keyword (replace 'keyword' with actual keyword)
    await page.fill('input[placeholder="Search"]', 'keyword');
    await page.press('input[placeholder="Search"]', 'Enter');

    // Wait for search results to load
    await page.waitForSelector('.search-results');

    // Take a screenshot of the search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_search_results.png'));

    return {
      success: true,
      action: "Searched message history for keyword and captured screenshots",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

