import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the login form
    await page.waitForSelector('#email');
    await page.fill('#email', 'your-email@example.com'); // Replace with actual email
    await page.waitForSelector('#password');
    await page.fill('#password', 'your-password'); // Replace with actual password

    // Click the login button
    await page.waitForSelector('button.login-btn');
    await page.click('button.login-btn');

    // Wait for the message history to load
    await page.waitForLoadState('networkidle');

    // Search for keyword in message history
    const keyword = 'your_keyword'; // Replace with the actual keyword
    const messages = await page.$$eval('.message', elements => 
      elements.map(el => el.textContent).filter(text => text.includes(keyword))
    );

    // Take screenshot after the search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    return {
      success: true,
      action: "Searched message history for keyword",
      extractedData: { messages },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
